import React, { Component } from 'react';
import ReactDom from 'react-dom';
import { Carousel, Item, Caption, Card, Col, Figure, Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import './vehicle_card.css'

import '../node_modules/bootstrap/dist/css/bootstrap.min.css'




export default function Cour_dynamic(prop) {
    let veh = prop.name;
    let veh_name = veh.toUpperCase();

    return (<div className="col-sm-12 col-md-6 col-lg-4">
        <Card className="col-12 col-md-12 col-lg-12 mt-10">
            <Card.Img variant="top" src={process.env.PUBLIC_URL + prop.name}  style={{ height: '100px',width: '100%' }}/>
            <Card.Body>
                <Card.Title>{veh_name}</Card.Title>
                <Card.Text>


                </Card.Text>
                <Button variant="primary" className="btn btn-sm ">Detail</Button>
            </Card.Body>
        </Card>

    </div>)

}
